public void testGetSeriesKey() {
    DefaultXYDataset d = createSampleDataset1();
    assertEquals("S1", d.getSeriesKey(0));
    assertEquals("S2", d.getSeriesKey(1));

    
    boolean pass = false;
    try {
         d.getSeriesKey(-1);
    }
    catch (IllegalArgumentException e) {
        pass = true;
    }
    assertTrue(pass);

    pass = false;
    try {
         d.getSeriesKey(2);
    }
    catch (IllegalArgumentException e) {
        pass = true;
    }
    assertTrue(pass);
}

